tinymce.PluginManager.add("iframe", function (t, e) {
        t.addButton("iframe", {
            image: e  + '/embed-page.svg',
            context: "tools",
            onclick: function () {
                t.windowManager.open({
                    title: "IFRAME URL/FILE IMPORT",
                    url: e + "/dialog.html",
                    width: 600,
                    height: 600,
                    buttons: [
                        {
                            text: "Insert",
                            onclick: function () {
                                var e = t.windowManager.getWindows()[0];
                                var content=e.getContentWindow().document.getElementById("post_thumbnail").value;
                                var height=e.getContentWindow().document.getElementById("width").value;
                                var width=e.getContentWindow().document.getElementById("height").value;

                                t.insertContent('<iframe src="'+content+'" width="'+width+'" height="'+height+'"></iframe>'), e.close();

                            },
                        },
                        { text: "Kapat", onclick: "close" },
                    ],
                });
            },
        });
});
